Even Donald Trump cannot ignore the importance of Indian commerce for the US. It comes as no surprise that the Fall-Winter edition of New York Fashion Week 2025 saw a slew of Indian brands and designers make a splash. Indian designers and brands are seizing every opportunity to make a significant impact on the international dialogue on fashion and retail.

At this year's 'Made In India' showcase, W for Woman, an Indian wear label from Aditya Birla Fashion and Retail, presented its Spring/Summer 2025 collection. Uppercase, an Indian luggage and accessories brand and Lino Perros, a handbag and footwear brand also showcased their new collection as did the streetwear brand, Cause & Effect. Homegrown resort-wear brand, Studio Moda showed at Flying Solo, a showcase of independent clothing brands at NYFW.

These showcases underscore the growing global resonance of India's fashion landscape, as designers adeptly blend traditional elements with modern sensibilities, appealing to a diverse international audience.

